    .mb-40px{margin-bottom: 40px;}

    .mb-20px{margin-bottom: 20px;}

    .text-uppercase{text-transform: uppercase}
    .fw-bold{ font-weight: 700}
    
body {
    background: #000;
    color: #fff;
    font-family: 'PT Serif', serif;
    font-weight: 400;
}
.main {
    padding-top: 60px;
    text-align: center;
    max-width: 1000px;
    margin: 0 auto;
}
 .logo IMG{ 
     max-height: 80px;
     margin-bottom: 20px;
     
}
h1 {
    font-size: 100px;
    letter-spacing: 6px;
    font-weight: 400;
}
 h2 {
    font-size: 32px;
    letter-spacing: 6px;
    font-weight:400;
}
 h3 {
    font-size: 28px;
    letter-spacing: 0px;
    font-weight:400;
     
}
 h4 {
    font-size: 20px;
    letter-spacing: 0px;
    font-weight:400;
     
}
    
.field1{ 
    width: 700px; 
    margin: 0 auto; 
    border-bottom: 2px solid #A190C8; 
    padding-bottom: 2px; 
    margin-bottom: 40px;
    font-size: 60px;
    padding-top: 50px;
    }

    footer{
        display: flex;
        justify-content: space-around;
        align-items: center;
        column-gap: 12px;
    }
    footer > div{ display: flex; flex-direction: column; grid-row-gap: 8px;}
  
    footer .date{ font-size: 20px; width: 200px;}
    footer .stamp{ ftext-align: center;}
    footer .sign{ font-size: 20px; width: 200px;}
      footer .data{ padding-bottom: 4px; border-bottom: 2px solid #A190C8; }
    
    
.main-bg {
    position: relative;
    min-height: 100vh;
/*    min-width: 100vw;*/
}
.bg-top-right {
    min-height: 100vh;
    min-width: 540px;
    background-position: right top;
    background-repeat: no-repeat;
    background-size: cover;
    position: absolute;
    top: 0px;
    right: 0px;
    z-index: 0;
    }
    
    .bg-btm-left {
    min-height: 100vh;
    min-width: 540px;
    background-position: bottom left;
    background-repeat: no-repeat;
        background-size: cover;
    position: absolute;
    bottom: 0px;
    left: 0px;
    z-index: 0;
    }
